sources.styles/utils/_reset.scss:
h1,
h2,
h3,
p {
  margin: 0;
}

ul {
  margin: 0;
  padding: 0;
}

* {
  box-sizing: border-box;
  transition-duration: 0.3s;
  transition-property: color, scele(), box-shadow, translate, border-color;
}

sources.styles/block/_container.scss:
.container {
  box-sizing: content-box;
  max-width: 1024px;
  padding: 0 40px;
  margin: 0 auto;

  @include tablet {
    padding: 0 23px;
  }
}

sources.styles/block/_page.scss:
.page {
  scroll-behavior: smooth;
  font-family: Poppins, Arial, Helvetica, sans-serif;
  font-weight: 400;
  font-size: 16px;
  line-height: 22px;
  color: #fff;

  &__body {
    margin: 0;
    background: rgb(29, 29, 28);

    &--with-menu {
      overflow: hidden;
    }
  }

  &__section-title {
    font-weight: 500;
    font-size: 64px;
    line-height: 64px;
    letter-spacing: -1.5px;
    text-align: center;
    margin-bottom: 48px;

    @include tablet {
      font-size: 48px;
      line-height: 48px;
    }

    @include mobile {
      font-size: 32px;
      line-height: 32px;
    }

    &--start {
      text-align: start;
      margin-bottom: 32px;
    }
  }

  &__header {
    margin-bottom: 120px;

    @include mobile {
      margin-bottom: 60px;
    }
  }

  &__menu {
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    transform: translateX(-100%);

    &:target {
      transform: translateX(0);
    }
  }

  &__advantages {
    margin-bottom: 164px;

    @include tablet {
      margin-bottom: 132px;
    }

    @include mobile {
      margin-bottom: 92px;
    }
  }

  &__compare {
    margin-bottom: 144px;

    @include tablet {
      margin-bottom: 120px;
    }

    @include mobile {
      margin-bottom: 92px;
    }
  }

  &__details {
    margin-bottom: 180px;

    @include tablet {
      margin-bottom: 120px;
    }

    @include mobile {
      margin-bottom: 80px;
    }
  }

  &__contact-us {
    margin-bottom: 182px;

    @include tablet {
      margin-bottom: 120px;
    }
  }
}

sources.styles/block/_header.scss:
.header {
  background-image: url(../images/header.png);
  background-size: cover;
  background-position: center;

  @include mobile {
    background-image: url(../images/header-mobile.jpg);

  }

  &__top {
    display: flex;
    justify-content: space-between;
    align-items: center;
  }

  &__icons {
    display: flex;
    position: relative;
    transform: translateY(-25%);
    gap: 0 40px;

    @include mobile {
      gap: 0 30px;
    }
  }

  &__content {
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    height: 100vh;
    padding: 36px 0 203px;

    @include tablet {
      padding: 34px 0 130px;
    }

    @include mobile {
      padding: 29px 0 88px;
    }
  }

  &__title {
    font-weight: bold;
    font-size: 80px;
    line-height: 80px;
    letter-spacing: -1.5px;
    text-align: center;

    @include tablet {
      font-size: 64px;
      line-height: 64px;
    }

    @include mobile {
      font-size: 36px;
      line-height: 36px;
    }
  }
}

sources.styles/block/_logo.scss:
.logo {
  &__img {
    height: 56px;

    @include tablet {
      height: 38px;
    }

    &:hover {
      box-shadow: (1px 4px 16px rgba(200, 191, 217, 0.4));
    }

    &--black {
      &:hover {
        box-shadow: (1px 4px 16px rgba(16, 15, 17, 0.8));
      }
    }
  }
}

sources.styles/block/_icon.scss:
.icon {
  display: block;
  position: relative;
  background-size: contain;
  background-position: center;
  background-repeat: no-repeat;
  width: 25px;
  height: 25px;

  @include mobile {
    width: 18px;
    height: 18px;
  }

  &--phone {
    background-image: url(../images/phone.svg);
  }

  &--menu {
    background-image: url(../images/menu.svg);

    &:hover {
      background-image: url(../images/menu-hover.svg);
    }
  }

  &--close {
    background-image: url(../images/menu-close.svg);
  }

  &__tooltip {
    display: block;
    width: max-content;
    position: absolute;
    right: 100%;
    top: 50%;
    transform: translateY(-50%);
    padding-right: 20px;
    font-size: 12px;
    font-weight: bold;
    line-height: 12px;
    letter-spacing: 2px;
    color: #fff;
    opacity: 0;
    pointer-events: none;

    @include mobile {
      display: none;
    }
  }

  &:hover &__tooltip {
    pointer-events: all;
    opacity: 1;
  }
}

sources.styles/block/_menu.scss:
.menu {
  background-color: #e5e5e5;

  &__content {
    height: 100vh;
    padding: 36px 0 0;
    overflow-y: auto;

    @include mobile {
      padding: 29px 0 0;
    }
  }

  &__top {
    display: flex;
    justify-content: space-between;
    align-items: center;
    margin-bottom: 48px;

    @include tablet {
      margin-bottom: 44px;
    }
  }

  &__list {
    list-style: none;
    margin-bottom: 48px;
  }

  &__item:not(:last-child) {
    padding-bottom: 32px;
  }

  &__link {
    text-decoration: none;
    color: #1d1d1d;
    font-size: 22px;
    font-weight: bold;
    line-height: 22px;
    letter-spacing: 2px;
    text-transform: uppercase;
    border-bottom: 1px solid transparent;

    @include tablet {
      font-weight: 600;
    }

    &:hover {
      border-color: #1d1d1d;
    }
  }

  &__call {
    display: block;
    width: max-content;
    font-size: 16px;
    line-height: 27px;
    color: #1d1d1d;
    font-weight: 700;
    text-decoration: none;

    @include tablet {
      font-weight: 600;
    }

    &:hover {
      box-shadow: (1px 4px 16px rgba(16, 15, 17, 0.8));
    }

    &--phone {
      margin-bottom: 16px;
    }

    &--action {
      text-transform: uppercase;
      letter-spacing: 2px;
      font-size: 12px;
      line-height: 16px;
      padding-bottom: 8px;
      border-bottom: 1px solid #000;
    }
  }
}

sources.styles/block/_advantages.scss:
.advantages {
  &__content {
    display: flex;
    justify-content: space-between;
    gap: 0 24px;

    @include mobile {
      flex-direction: column;
    }
  }

  &__paragraph {
    width: 50%;
    font-size: 23px;
    font-weight: 500;
    line-height: 32px;

    @include mobile {
      width: 100%;
    }
  }
}

sources.styles/block/_compare.scss:
.compare {
  &__content {
    display: flex;
    gap: 0 24px;

    @include tablet {
      display: flex;
      flex-direction: column;
      align-items: center;
    }
  }

  &__card {
    display: flex;
    flex-direction: column;
    width: 33.33%;

    @include tablet {
      width: 392px;
    }

    @include mobile {
      width: 280px;
    }
  }

  &__img {
    width: 100%;
    object-fit: cover;
    margin-bottom: 32px;

    &:hover {
      transform: scale(1.05);
    }
  }

  &__card-title {
    margin-bottom: 8px;
  }

  &__link {
    text-decoration: none;
    color: inherit;
    font-size: 24px;
    line-height: 34px;
    font-weight: bold;
    letter-spacing: 1px;

    &:hover {
      color: rgba(200, 191, 217, 0.4);
    }
  }

  &__desc {
    margin-bottom: 16px;
    flex: 1 1;
  }

  &__price {
    font-size: 24px;
    line-height: 34px;
    font-weight: bold;
    letter-spacing: 1px;
  }
}

sources.styles/block/_details.scss:
.details {
  &__images {
    display: flex;
    justify-content: center;
    gap: 0 24px;

    @include mobile {
      gap: 0 20px;
    }
  }

  &__image {
    max-width: 672px;
    min-width: 130px;
    max-height: 320px;
    object-fit: cover;

    &--big {
      max-width: 66.66%;

      @include mobile {
        width: 50%;
      }
    }

    &--small {
      min-width: 33.33%;

      @include mobile {
        width: 50%;
      }
    }

    &:hover {
      transform: scale(1.05);
    }
  }

  &__subtitle {
    margin-top: 16px;
    margin-bottom: 8px;
  }

  &__desc {
    margin-bottom: 48px;

    @include mobile {
      margin-bottom: 40px;
    }
  }

  &__button {
    width: 324px;
    margin: 0 auto;

    @include tablet {
      width: 392px;
    }

    @include mobile {
      width: 100%;
    }
  }
}

sources.styles/block/_button.scss:
.button {
  display: flex;
  justify-content: center;
  align-items: center;
  height: 56px;
  font-size: 16px;
  line-height: 27px;
  font-weight: bold;
  border: 1px solid transparent;
  border-radius: 40px;
  color: #000;
  text-decoration: none;
  background-color: #fff;

  &:hover {
    filter: drop-shadow(1px 4px 16px rgba(232, 232, 240, 0.4 ));
  }

  &:focus {
    filter: drop-shadow(1px 4px 16px rgba(232, 232, 240, 0.64));
  }
}

sources.styles/block/_contact-us.scss:
.contact-us {
  &__content {
    display: grid;
    grid-template-columns: repeat(12, 1fr);
    column-gap: 24px;

    @include tablet {
      grid-template-columns: repeat(6, 1fr);
    }

    @include mobile {
      grid-template-columns: repeat(2, 1fr);
    }
  }

  &__info-content {
    display: flex;
    flex-direction: column;
    min-width: max-content;
    gap: 24px;
  }

  &__info-title {
    margin-bottom: 8px;
    font-size: 14px;
  }

  &__info-link {
    font-weight: 500;
    text-decoration: none;
    color: inherit;

    &:hover {
      color: rgba(200, 191, 217, 0.4);
    }
  }

  &__grid {
    grid-column: 8 / 10;

    @include tablet {
      grid-column: 4 / 6;
    }

    @include mobile {
      grid-column: 1 / -1;
    }
  }
}

sources.styles/block/_form.scss:
.form {
  @include mobile {
    margin-bottom: 48px;
  }

  &__input {
    border-radius: 40px;
    height: 48px;
    margin-bottom: 16px;
    width: 100%;
  }

  &__message {
    border-radius: 16px;
    height: 148px;
    margin-bottom: 32px;
    resize: none;
    width: 100%;
  }

  &__button {
    width: 100%;
  }

  &__grid {
    grid-column: 1/6;

    @include tablet {
      grid-column: 1/4;
    }

    @include mobile {
      grid-column: 1/3;
    }
  }
}

sources.styles/block/_form-field.scss:
.form-field {
  border: 1px solid transparent;
  background-color: #f8f8fa;
  padding: 14px 16px;
  color: #292929;
  font-family: inherit;
  font-size: 14px;
  line-height: 20px;
  outline: none;

  &::placeholder {
    color: #7e7e83;
  }

  &:hover {
    box-shadow: (1px 4px 16px rgba(232, 232, 240, 0.4));

    &::placeholder {
      color: #292929;
    }
  }

  &:focus {
    box-shadow: (1px 4px 16px rgba(232, 232, 240, 0.64));

    &::placeholder {
      color: #292929;
    }
  }
}

sources.styles/block/_footer.scss:
.footer {
  height: 555px;
  background-image: url(../images/footer.jpg);
  background-position: center;
  background-size: cover;

  @include tablet {
    height: 480px;
  }

  @include mobile {
    height: 200px;
  }
}
